    var body =
    [['Kapil', 'Jaipur', 'MCA'],
    ['Aakash', 'Hisar', 'Btech'],
    ['Mani', 'Ranchi', 'MSc'],
    ['Yasfh', 'Udaipur', 'Mtech']
    ];
    useEffect(() =>{
        axios.get('https://jsonplaceholder.typicode.com/posts')
        .then(res =>{
            console.log(res)
            setPosts(res.data)
        })
        .catch(err =>{
            console.log(err)
        })
    }, [])

    return(
        <div>
            <Table heading={heading} body={posts} />
        </div>
    )
}

